import React from 'react'
import Register from './pages/Register';
import {BrowserRouter, Route, Router} from 'react-router-dom';
const App = () => {
	return (
		<div className='App'>
			<BrowserRouter>
			<Route path='/' element={<Register />}>

			</Route>
			</BrowserRouter>
			<Register />
		</div>
	)
}

export default App
